function namespace(t,e){if(typeof t!=="string"){throw'Namespace must be string but it is: "'+t+'"'}if(this!==undefined&&this instanceof namespace){throw'This function is not supposed to be called with the "new" keyword'}var i=t.split(".");var n=typeof e==="object"?e:this;if(n===undefined){throw"Can't attach the namespace to something"}for(var o=0;o<i.length;o++){var r=i[o];if(r.length===0){continue}if(!/^[a-z\$_]/i.test(r.charAt(0))){throw'Identifier should start with a letter, underscore or dollar sign: "'+r+'"'}if(!/^[\w\$_]+$/.test(r)){throw'Invalid identifier: "'+r+'"'}if(typeof n[r]!=="object"||n[r]===null){n[r]={}}n=n[r]}return n}